import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import HomePage from './Pages/HomePage';
import Example from './Pages/Example'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Example />}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
